import React from 'react';

function DoctorCard({ name, specialty }) {
  return (
    <div className="bg-white border rounded-lg p-4 text-center">
      <img
        src="https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82"
        alt={name}
        className="w-20 h-20 mx-auto rounded-full mb-4"
      />
      <h3 className="text-lg font-medium">{name}</h3>
      <p className="text-gray-500">{specialty}</p>
      <div className="flex justify-center gap-2 mt-4">
        <button className="px-4 py-1 bg-red-500 text-white rounded-md">Remove</button>
        <button className="px-4 py-1 bg-gray-300 text-gray-800 rounded-md">Edit</button>
      </div>
    </div>
  );
}

export default DoctorCard;
